import Foundation
import XCTest

@testable import NautilusTelemetry

final class CompressionTests: XCTestCase {
	
	func testDeflate() throws {
		let zlibOut = try Compression.compressDeflate(data: logData)
		
		XCTAssert(zlibOut.count < logData.count)
		XCTAssertEqual(zlibOut.count, 2338, accuracy: 200) // 2338 bytes expected output size -- future lib versions may vary in size
	}

	func testDeflatePerformance () throws {
		measure {
			do {
				_ = try Compression.compressDeflate(data: logData)
			}
			catch {
				XCTFail()
			}
		}
	}

	func skipOnOldOS() throws {
#if os(iOS)
		if !ProcessInfo.processInfo.isOperatingSystemAtLeast(.init(majorVersion: 15, minorVersion: 0, patchVersion: 0)) {
			// workaround -- @available doesn't cause skip
			try XCTSkipIf(true, "Unsupported iOS version")
		}
#endif
		
#if os(macOS)
		if !ProcessInfo.processInfo.isOperatingSystemAtLeast(.init(majorVersion: 12, minorVersion: 0, patchVersion: 0)) {
			// workaround -- @available doesn't cause skip
			try XCTSkipIf(true, "Unsupported macOS version")
		}
#endif
	}
	
	func testBrotli() throws {
		try skipOnOldOS()
		
		if #available(iOS 15.0, *) {
			let brotliOut = try Compression.compressBrotli(data: logData)
			XCTAssert(brotliOut.count < logData.count)
			//Brotli level 2 only, which is not massively better than deflate
			XCTAssertEqual(brotliOut.count, 2102, accuracy: 200) // 2102 bytes expected output size -- future lib versions may vary in size
		}
	}
	
	func testBrotliPerformance () throws {
		try skipOnOldOS()

		if #available(iOS 15.0, *) {
			measure {
				do {
					_ = try Compression.compressBrotli(data: logData)
				}
				catch {
					XCTFail()
				}
			}
		}
	}

